import React from 'react';
import { LoginButton } from '../../components';
import './Login.css';

const Login = () => {
  return (
    <div>
      <div className="login-container">
        <h2 className="login-header">Login</h2>
        <div>
          <LoginButton />
        </div>
      </div>
    </div>
  );
};

export default Login;
